window.bookSummaryJSON = "<p>The Circle's job was to protect the innocent. </p> <p>But what happens when the innocent aren't exactly what they seem? </p> <p>What happens when they become the Nine? </p> <p>Gabriel can't bring himself to look at me. Broken wings. Broken will. </p> <p>Titus lays in a hospital bed, with the vultures hovering close. </p> <p>Rival stands beside me...but he may as well be on the other side of the world for all the lies that divide us. </p> <p>They killed my family.</p> <p>They tortured those I love. </p> <p>I won't wait for death to come for Titus. </p> <p>I'll become the monster they feared and hunt them down. </p> <p>The Nine tremble at the sight of my father, Lucifer? </p> <p>They haven't met me yet. </p> <p>Contains mature themes.</p>"; 
